export {ADD,SQUARE} from '../constans/ActionTypes'

const addOne = {
    type: ADD,
    num: 1
}

const addTwo = {
    type: ADD,
    num: 2
}

const square = {
    type: SQUARE
}

export {
    addOne,
    addTwo,
    square
}
